import React from 'react'
import PanelElement from './PanelElement'

function PanelContainer({ children }) {
    return (
        <>
        <PanelElement>{children}</PanelElement>
        <PanelElement>{children}</PanelElement>
        <PanelElement>{children}</PanelElement>
        </>
    )
}

export default PanelContainer
